column1:
@Meli__Melo_ J’ai fait de la photo en noir et blanc en labo, rien de mieux ;)
Heu par contre pour la braguette, non, pour un mec ça passe pas… 😇
P’naise par contre on voit tous les code des photos de mode de l’époque… c’est peut être ce qui manque un peu aujourd’hui.

@bernathoustra @montebourg Je croyais que c’était un accident de braguette de la chambre 2806.
Avec Strauss-Kahn, on n’aurait eu ni Hollande, ni Macron.
De quoi nourrir quelques regrets 😬
